but, ia pun tertarik untuk memasuki&nbsp; gua besar yang gelap,di dalam sana tidak ada petunjuk untuk mengetahui waktu hingga ia memiliki jadwal makan dan tidur yang tidak menentu. Alhasil, ketika dia kembali ke pantai, dia lupa waktu. Dia mulai mengukur lagi ketinggian air pasang. Namun, kali ini, ia juga sibuk dalam kegiatan lain seperti mengumpulkan makanan dan membuat rakit. Jadi datanya, seperti yang diberikan pada Tabel 2, diambil hanya secara sporadic(tidak full). Temukan tingginya pasang pada pukul 16:00 pada hari itu,&nbsp;</span></span></span></p><div><table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; width:358px\">	<tbody>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:47px\">			<p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jam</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:132px\">			<p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Ketinggian (m)</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:47px\">			<p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jam&nbsp;</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:132px\">			<p style=\"text-align:center\"><span style=\"font-size:12pt\"><span 