e=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Fisika bintang sering melibatkan persamaan keadaan (</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>equation of state</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">) untuk bintang, yang biasanya merupakan hubungan antara tekanan P dan densitas</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> &rho;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">. Kelompok bintang-bintang yang cocok dengan tebakan seperti itu dikenal sebagai polytopes dan dirumuskan sebagai</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">P=K&rho;<sub><sup>y</sup></sub></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">di mana K adalah konstanta dan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&gamma; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">adalah konstanta yang bergantung pada tekanan dan suhu inti tertentu dari sebuah bintang. Mengingat ini, tunjukkan bahwa seseorang dapat memperoleh hubungan antara massa M dari sebuah bintang politopik dan jari-jarinya R&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">M&prop;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R<span style=\"font-family:Courier New,Courier,monospace\"><sup>a</sup></span></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">a) Temukan <span style=\"font-family:Courier New,Courier,monospace\">a</span>  </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> untuk bintang polytopes.&nbsp; Juga, tunjukkan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> jika massanya tidak bergantung pada radius R.</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">b) Hubungan radius dengan massa untuk benda hitam ideal yang tidak berputar dan tidak bermuatan diketahui dari relativitas&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> 2GM /</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> c</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"><sup>2</sup></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Selain itu, Stephen Hawking menunjukkan bahwa lubang hitam berperilaku seperti benda hitam, di mana suhunya suhu (dikenal sebagai suhu Hawking) diberikan oleh</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">T=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">Ä§</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">c</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"><sup>3</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> / 8&pi;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">k</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"><sub>B</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">GM</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Dengan informasi ini, tunjukkan bahwa masa hidup lubang hitam, t* sebanding dengan massanya&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">t* &prop; M<span style=\"font-family:Courier New,Courier,monospace\"><sup>B</sup></span></span></span></span></p><p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">&nbsp; di mana Anda harus menemukan <span style=\"font-family:Courier New,Courier,monospace\">B</span></span></span></span></p>','','','','','',0,''),(6,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pada bulan Juni 2011, para ilmuwan melaporkan penemuan quasar terjauh yang diketahui memiliki pergeseran merah lebih besar daripada 1. Quasar ini terletak di rasi Leo, dan dinamakan ULAS J1120+0641 memiliki luminositas 6,3 x 10</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>13</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> luminositas matahari. Gambar di bawah menunjukkan spektrumnya dalam panjang gelombang inframerah. Konstanta Hubble 68,7 Km/s/Mpc</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/jwFR775/Screenshot-166.png\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">a) Pada Gambar di atas, garis Lyman-&alpha; mengalami pergeseran merah dari panjang gelombang diam 1216 &Aring;. Hitung pergeseran merah z dari quasar ini.</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">b) Hitunglah magnitudo semu quasar ini seperti yang terlihat dari Bumi, dengan asumsi tidak ada kepunahan antargalaksi. Petunjuk: </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>comoving distance</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> dapat dihitung dari&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">d</span></span></span><span style=\"font-size:14px\"><sub><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">c</span></span></sub></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">z</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">d</span></span></span><span style=\"font-size:12px\"><sub><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">H</span></span></sub></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&chi;(z)</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">di mana </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">z</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">adalah faktor tak berdimensi yang besarnya sama dengan 2 untuk quasar ini, </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">d</span></span></span><span style=\"font-size:12px\"><sub><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">H</span></span></sub></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> adalah jari-jari Hubble, jarak di mana benda-benda mundur lebih cepat daripada kecepatan cahaya karena ekspansi kosmologis (Hubble)</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">c) Perkirakan usia Alam Semesta pada saat memenuhi kondisi kesetimbangan materi</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">-</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">radiasi, mengingat kesetimbangan materi</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">-</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>Dark Energy</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> telah terjadi 4,05 miliar tahun yang lalu. Petunjuk: Dalam alam semesta yang didominasi radiasi, diketahui </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&Omega;<sub>m,0</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">=0,31</span></span><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">,</span></span><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> &Omega;<sub>r,0</sub>=9,1&times;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">10</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">-5</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">a(t) &prop; t<sup>1/</sup></span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">2</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">, </span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Dominasi materi,&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">a(t) &prop; t<sup>2/</sup></span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">3</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">, </span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Dan dominasi energi gelap,</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">a(t) &prop; e<sup>t</sup></span></span></span><sup>&radic;(&Delta;/3)</sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">, </span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">d) Dari bentuk persamaan Friedmann ini</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/Jnc1PM1/Screenshot-167.png\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">di mana&nbsp;</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&rho; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">adalah kerapatan alam semesta pada waktu t,</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> </span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&rho;<sub>0</sub></span></span><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> adalah kerapatan arus alam semesta, dan&nbsp;</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">&rho;<sub>c,0</sub></span></span><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> adalah kerapatan kritis alam semesta saat ini,&nbsp;</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">tunjukkan bahwa persamaan tersebut dapat dimanipulasi untuk mendapatkan</span></span></span></p><p style=\"text-align:center\"><img alt=\"\" src=\"https://i.ibb.co/NLLtt90/Screenshot-168.png\" /></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">dengan mempertimbangkan berbagai komponen Semesta kita dan menggunakan definisi parameter Hubble H(a), di mana </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">a</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">adalah laju perubahan faktor skala.</span></span></span></p>','','','','','',0,''),(7,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Satelit buatan Bumi memiliki massa 100 kg dan bergerak sepanjang orbit elips dengan ketinggian perigee sama dengan 200 km dan ketinggian apogee sama dengan 10000 km. Karena dekat dengan perigee, satelit diperlambat oleh atmosfer bumi. Perkirakan waktu, di mana orbit satelit akan menjadi lingkaran. Gaya perlambatan atmosfer dapat dianggap konstan dengan nilai 0,01 Newton, panjang lintasan satelit melalui atmosfer setiap revolusi sama dengan jari-jari Bumi. Asumsikan lintasan satelit melewati atmosfer sebesar jejari bumi. Hint: untuk </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">xâ‰ª1;(</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">1+x)</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">n</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">=1+<em>nx</em></span></span></span></p>','','','','','',0,'');
