INSERT INTO `ekonomi` VALUES (1,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Elastisitas harga permintaan bagi </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>durable goods</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dalam jangka panjang cenderung ...</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Lebih elastis daripada elastisitas pada jangka pendek</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sama dengan elastisitas pada jangka pendek</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tidak terpengaruhi oleh jangka waktu</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kurang elastis daripada elastisitas jangka pendek</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Memiliki elastisitas uniter</span></span></span></p>',1,'a'),(2,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Daya monopoli dikatakan sumber dari </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>market failure</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> karena &hellip;</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berproduksi dengan tingkat output yang lebih rendah dibanding persaingan sempurna</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Menyebabkan excess burden</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Adanya free rider</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Menyebabkan lemons problem</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Merupakan price taker</span></span></span></p>',1,'b'),(3,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The diagram shows the output of grapefruits and watermelons that can be produced in Malaysia and Germany with a given quantity of resources.</span></span></span><img alt=\"\" src=\"https://i.ibb.co/Jm44xQG/Screenshot-164.png\" /></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Four grapefruits for one watermelon</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Two grapefruits for one watermelon</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Three grapefruits for one watermelon</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">One grapefruit for one watermelon</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Three grapefruits for two watermelons</span></span></span></p>',1,'b'),(4,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Suppose there is an increase in the price of LCD monitors and an increase in production technology. The price and quantity equilibrium for the CPU will ...</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Price equilibrium increases, quantity equilibrium ambiguous</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Both price and quantity decreases</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Price equilibrium ambiguous, quantity equilibrium increases</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Price equilibrium decreases, quantity equilibrium ambiguous</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Price equilibrium increases, quantity equilibrium ambiguous</span></span></span></p>',1,'d'),(5,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;Berikut ini pernyataan yang benar terkait kurva indiferensi&hellip;.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berbentuk L untuk dua barang ya