style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar tetapi alasannya salah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama salah tetapi alasannya benar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika baik pernyataan utama maupun alasannya salah</span></span></span></p>',1,'b'),(47,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Dalam jangka panjang perusahaan di pasar monopoli dapat memperoleh kerugian</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">SEBAB</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Monopolis berproduksi secara tidak efisien di jangka panjang</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar serta keduanya berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar tetapi keduanya tidak berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar tetapi alasannya salah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama salah tetapi alasannya benar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika baik pernyataan utama maupun alasannya salah</span></span></span></p>',1,'d'),(48,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Apresiasi nilai rupiah akan meningkatkan impor Indonesia</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">SEBAB</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Apresiasi rupiah mengakibatkan barang-barang luar negeri relatif lebih murah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar serta keduanya berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar tetapi keduanya tidak berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar tetapi alasannya salah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama salah tetapi alasannya benar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika baik pernyataan utama maupun alasannya salah</span></span></span></p>',1,'a'),(49,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Overstated</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> pada modal akhir pada laporan keuangan 2019 akan menyebabkan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>overstated</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> pada modal awal 2020</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">SEBAB</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Modal akhir 2019 merupakan modal awal 2020</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar serta keduanya berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar tetapi keduanya tidak berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar tetapi alasannya salah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama salah tetapi alasannya benar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika baik pernyataan utama maupun alasannya salah</span></span></span></p>',1,'a'),(50,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Barang publik dan eksternalitas merupakan salah dua penyebab kegagalan pasar</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">SEBAB</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Baik barang publik dan eksternalitas mengakibatkan terjadinya </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>lemons problem </em></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar serta keduanya berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar dan alasannya benar tetapi keduanya tidak berhubungan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama benar tetapi alasannya salah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika pernyataan utama salah tetapi alasannya bena</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">jika baik pernyataan utama maupun alasannya salah</span></span></span></p>',1,'c'),(51,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">According to the news, the international price and quantity of gold has increased. Asked by their president to explain such a phenomenon, 5 economists of the Frey</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><u> </u></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Nations have come to different interpretations.</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Zulfan</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">: The demand has increased. The supply is however, perfectly inelastic</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Calista</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">: The demand has increased. The supply is however, perfectly elastic</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Raisa</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">: The supply has decreased. The demand is however unit elastic</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eben</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">: The demand has increased. The supply is however unit elastic</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Zidan</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">: The supply has increased. The demand is however perfectly elastic</span></span></span></li></ol><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Whom do you think has the right answer? Explain and use graphs to support your argument.</span></span></span></p>','','','','','',0,''),(52,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fungsi permintaan dan penawaran yang dihadapi oleh sebuah perusahaan terlukiskan oleh kurva dalam gambar berikut:</span></span></span></p><p><img alt=\"\" src=\"https://i.ibb.co/pyQ68kz/Screenshot-169.png\" /></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika pemerintah menetapkan pajak per unit produksi bagi perusahaan sebesar Rp3, maka:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Bagaimana dampak dari kebijakan pajak per unit terhadap penawaran perusahaan? Tunjukkan dengan kurva!</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hitunglah keseimbangan setelah pajak, total </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>deadweight loss </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">yang terjadi akibat pajak, total pajak yang diterima pemerintah, dan alokasi beban pajak yang harus ditanggung penjual dan pembeli!</span></span></span></li></ol>','','','','','',0,''),(53,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jelaskan secara komprehensif tentang apa yang akan terjadi dengan kondisi </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>net export</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> Indonesia apabila:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Amerika Serikat sebagai mitra dagang Indonesia mengalami resesi,</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kampanye yang meningkatkan jiwa nasionalisme Amerika mendorong pembelian produk lokal oleh masyarakatnya,</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat pengetatan barang yang masuk dari Indonesia ke Uni Eropa khususnya untuk </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>crude palm oil</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> (CPO).</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pemerintah Vietnam menerapkan insentif terhadap barang ekspor negaranya </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>ceteris paribus</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">, sedangkan bagi Amerika barang dari Indonesia dan Vietnam sifatnya substitusi.</span></span></span></li></ol>','','','','','',0,''),(54,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Davina baru saja memenangkan lomba </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>business case </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dan mendapat hadiah sebesar Rp250.000.000,00. Davina memiliki rencana untuk menginvestasikan uang yang dia peroleh di beberapa tempat, yaitu:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Obligasi pemerintah dengan return 3,56% per tahun</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Emas murni dengan kenaikan rata-rata 4,12% per tahun</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Properti dengan return 4,79% per tahun</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jual beli valas khususnya US$ dengan spread 6, 49%</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Saham perusahaan besar dengan capital gain 5,68% per tahun</span></span></span></li></ol><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berdasarkan data tersebut, urutkan investasi yang mendapatkan keuntungan/hasil/pendapatan terbesar untuk Davina! Sertakan rasional/alasan perhitungan anda!</span></span></span></p>','','','','','',0,''),(55,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Read the article below!</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>COVID-19 accelerating shifts in Indonesian consumer behaviour</strong></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>by DBS Group Research</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Updated September 22, 2020</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>(</em></span></span></span><a href=\"https://www.dbs.id/id/personal/aics/templatedata/article/generic/data/en/GR/092020/200922_insights_id_consumer.xml#\" style=\"text-decoration:none\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#1155cc\"><em><u>https://www.dbs.id/id/personal/aics/templatedata/article/generic/data/en/GR/092020/200922_insights_id_consumer.xml#</u></em></span></span></span></a><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>)&nbsp;</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The Indonesian government has enacted several policies to reduce the spread of the COVID-19 virus, such as introducing partial lockdowns or large-scale social restrictions (PSBB). The implications are far reaching, and our economists are expecting Indonesia&rsquo;s GDP to contract by 1% in 2020, from 5% growth previously.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">To ascertain the impact of the virus outbreak and the lockdown on consumer behaviour, we conducted a consumer survey to find out how behaviours and spending habits are changing, as well how consumer products companies are responding and adapting.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The survey results, while not surprising, astounded us in terms of magnitude. We summarised the impact using our acronym &ndash; 3HATS: Health, Home-ward focused, Home-cook, Accelerated e-commerce, and Traditional grocery no more. Furthermore, given the uncertainty, it seems that the respondents are cautious on their outlook, and are putting more of their income into savings and investments, at least for the next 3-6 months, rather than spending on discretionary items and activities.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">With the outbreak of COVID-19, we believe our long-term expectation (i.e. spending on food to decline) is intact but expect some changes between 2020-2022F. As a percentage of the total consumption basket, we now project food to be higher at 50.1% in 2020F (vs 49% previously) and gradually decline as the economy recovers in 2021-2022.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">We also conducted interviews with several consumer companies touching on the impact of this pandemic, how they are readjusting and their views on the outlook. The companies we spoke to seem to be coping well, though the commonality is uncertainty of what lies ahead, as well as the need to pivot towards diversification, be it product, geography, sales channel, etc.</span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Going the fiscal distance to save Indonesia&rsquo;s economy from COVID-19</strong></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>by Dr. Muhammad Chatib Basri, S.E., M.Ec., University of Indonesia</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Updated March 29, 2020</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>(</em></span></span></span><a href=\"https://www.eastasiaforum.org/2020/03/29/going-the-fiscal-distance-to-save-indonesias-economy-from-covid-19/\" style=\"text-decoration:none\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#1155cc\"><em><u>https://www.eastasiaforum.org/2020/03/29/going-the-fiscal-distance-to-save-indonesias-economy-from-covid-19/</u></em></span></span></span></a><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>)</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&hellip;.&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The government must adjust its fiscal policy to suit the situation, its priorities and respond quickly. Until the government can control the spread of the virus, the Indonesian economy will continue to come under pressure.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The Indonesian government needs to take a number of steps urgently.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">It should focus, first, on handling the outbreak and decreasing its spread. Indonesia has a large population and COVID-19 spreads quickly. The government must plan for scenarios where the outbreak spreads uncontrollably, as many other countries have experienced.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The government must ensure that there are enough hospitals to care for patients. Sufficient test kits, medical personnel, medicine and appropriate medical procedures are also essential. This requires huge funding. For those losing their livelihoods, monthly health insurance bills will become a significant burden. The government is rightly covering the healthcare costs of coronavirus patients. But on a larger scale, this policy will require a larger budget.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">COVID-19 will clearly have a huge economic impact and many will lose their jobs. To mitigate this and ensure that the middle to lower classes are able to fulfil their daily needs, the government should increase and expand the Cash Transfer, Conditional Cash Transfer and Non-Cash Food Aid programs.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">The range of households eligible for support should be expanded beyond the poor to the lower-middle class. It might be better to focus on urban areas &mdash; they are at greater risk of COVID-19 infection due to high population density. If the urban stimulus is insufficient, those who lose their jobs will return to villages, increasing the risk of urban residents spreading the virus to rural areas.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">It&rsquo;s vital to control food stocks and pharmaceutical supplies. Price hikes due to insufficient stock will lead to panic and social unrest. Managing this is not easy, as the supply and distribution of sufficient stock must be considered.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Businesses are going to be hard hit. There is a risk that companies will face difficulty meeting their debt obligations. So it is important to take steps to relax credit restructuring.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Everything above requires funding. But with the decrease in oil and commodity prices, as well as the slowing economy, government revenue will be hit hard. The government will have to reallocate its budget from low-urgency activities to healthcare and social safety nets.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Budget reprioritization is important, but the budget deficit will have to rise. Budget deficit financing might be a problem. A large budget deficit will crowd out the banking sector, while financing the deficit through global bonds is expensive. So the government has to prepare to receive international support both from bilateral and multilateral agencies.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perhaps the Indonesian government can establish a Deferred Drawdown Option &mdash; a contingent credit line that allows the borrower to rapidly meet its financing requirements following a shortfall in budget financing due to an unfavourable global bond market.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fiscal stimulus measures need to focus on the health sector and social aid to handle the outbreak. Only after the outbreak is under control, and social distancing ends, can &lsquo;standard fiscal stimulus and monetary policy&rsquo; be used to support aggregate demand.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">All this may not be enough to solve the crisis, but as Albert Camus wrote, &lsquo;to state quite simply what we learn in time of pestilence: that there are more things to admire in men than to despise&rsquo;.</span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Questions:</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Based on what you have read on the articles,</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Explain and graph the AD-AS curve to show the impact of the COVID 19 pandemic on the Indonesian economy and determine what happens to the price level and output!</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">If the government decides to use policies to neutralize the condition of the Indonesian economy, explain what policies the government can do!</span></span></span></li></ol>','','','','','',0,'');
/*!40000 ALTER TABLE `ekonomi` ENABLE KEYS */;
UNLOCK TABLES;

