INSERT INTO `fisika` VALUES (1,'<p><a href=\"https://imgbb.com/\"><img alt=\"1\" src=\"https://i.ibb.co/cwv3Yqr/1.jpg\" /></a> Sebuah peluru ditembakkan dari titik A ke titik B dimana titik A dan B merupakan titik-titik sudut alas suatu segitiga ABC (lihat gambar). Segitiga ABC sebidang dengan lintasan peluru. Lintasan peluru diketahui berjarak H dari titik C (titik puncak segitiga). Jika diketahui sudut &ang;BAC , sudut &ang;ABC dan jarak AB adalah L, tentukan:</p><p>a. sudut elevasi ketika peluru ditembakkan.</p><p>b. laju awal peluru ketika ditembakkan jika &alpha; = &beta; Nyatakan semua jawaban dalam H, L, &alpha;, dan</p>','','','','','',0,''),(2,'<p><a href=\"https://imgbb.com/\"><img alt=\"2\" src=\"https://i.ibb.co/xs28mtw/2.jpg\" /></a> Sebuah bola dengan jari-jari r, massa m, dan momen inersia &amp;beta mr<sup>2</sup> dilempar secara horizontal ke kanan dengan kecepatan awal v<sub>0</sub> dan dari ketinggian h. Selain itu, bola memiliki kecepatan sudut awal &omega; <sub>0</sub> berlawanan dengan arah jarum jam. Koefisien gesek antara bola dan lantai horizontal adalah &mu; .</p><p>Petunjuk : untuk 0 &lt; x &lt; 1 1+x<sup>2</sup>+x<sup>3</sup>+x<sup>4</sup>+&hellip;+x<sup>n</sup> = <sup>1-x<sup>(n+1)</sup></sup>&nbsp;/<sub>1 - x</sub></p><p>Untuk soal-soal dibawah anggap tumbukan antara bola dan lantai bersifat elastis. Selain itu, anggap selama proses tumbukan benda slip.</p><p>a. Berapakah kecepatan horizontal akhir bola, setelah tidak ada slip pada tumbukan? (Nyatakan dalam r, &beta;, v<sub>0</sub>, dan &omega; <sub>0</sub>)</p><p>b. Bagaimana kecepatan sudut awal bola (&omega;&nbsp;<sub>0</sub>) mempengaruhi gerakan bola?</p><p>c. Jika bola diberi kecepatan sudut awal kritis (&omega;<sub>0c</sub>), setelah beberapa saat bola akan diam secara horizontal dan hanya akan memantul naik turun. Tentukanlah kecepatan sudut awal kritis tersebut! (Nyatakan dalam r dan v<sub>0</sub>).</p><p>d. Dalam kasus pada soal 1c, pada pantulan keberapakah (n) bola akan kehilangan kecepatan horizontalnya? (Nyatakan dalam v<sub>0</sub>, r,g,h,dan &mu; )</p>','','','','','',0,''),(3,'<p>Sebuah roller terdiri dari silinder homogen padat bermassa M dan jari-jari r; itu bertumpu pada meja horizontal dan melekat pada dinding melalui pegas heliks dari konstanta pegas k (lihat gambar). Pegas dapat diasumsikan memiliki massa yang dapat diabaikan dan ideal, yaitu hukum Hooke tetap berlaku untuk deformasi besar.</p><p><a href=\"https://imgbb.com/\"><img alt=\"3\" src=\"https://i.ibb.co/ys42FVv/3.jpg\" /></a></p><p>a) Pertama, anggaplah tidak ada gesekan antara silinder dan meja. Rol didorong ke samping dan dilepaskan; tentukan periode getaran T<sub>0</sub>!</p><p>b) Mulai sekarang, koefisien gesekan antara roller dan meja &mu; tidak lagi diabaikan. Rol didorong ke samping dan mulai berguling maju mundur. Untuk amplitudo osilasi kecil, tidak ada slip antara roller dan permukaan. Cari periode baru dari osilasi T<sub>r</sub>!</p><p>c) Jika amplitudo osilasi awal (diukur sebagai deformasi x pegas) lebih besar dari nilai kritis tertentu A<sub>*</sub>, amplitudo osilasi mulai menurun seiring waktu. Nyatakan A<sub>*</sub> dalam bentuk k, M, r, percepatan jatuh bebas g, dan &mu;.</p><p>d) Dengan asumsi bahwa amplitudo awal A<sub>0</sub> jauh lebih besar dari A<sub>*</sub>, berapakah kecepatan sudut maksimum silinder selama 0 &lt; t &lt; <sup>T</sup>/<sub>2</sub>, di mana t adalah waktu yang berlalu sejak roller dilepaskan?</p><p>e) Dengan asumsi bahwa A<sub>0</sub> &gt; A<sub>*</sub>, buat sketsa grafik kualitatif yang menunjukkan ketergantungan Ïµr dan a sebagai fungsi waktu; di sini Ïµr dan &alpha; masing-masing menunjukkan percepatan sudut dan percepatan linier roller.</p>','','','','','',0,''),(4,'<p>Sebuah koin tipis uniform dengan jari-jari r menggelinding tanpa slip diatas lantai datar Lintasan koin berbentuk lingkaran dengan jari-jari R. Koin menggelinding dengan bidang koin membentuk sudut konstan &theta; terhadap arah vertikal seperti pada gambar. <a href=\"https://imgbb.com/\"><img alt=\"4\" src=\"https://i.ibb.co/fdxGNdf/4.jpg\" /></a></p><p>a) Jika T adalah waktu yang diperlukan koin untuk menempuh lintasan berjari-jari R dengan &Omega; =2&pi;/T dan jika t adalah waktu yang diperlukan oleh koin untuk berotasi terhadap porosnya, dengan &omega;=2&pi;/t. Tuliskan hubungan antara &Omega; dan &omega; !</p><p>b) Koin dapat dipandang dari kerangka acuan inersial yang sesaat bergerak bersama dengan pusat koin. Tentukan &omega;<sub>2</sub>, kecepatan sudut koin pada arah x<sub>2</sub> dan, &omega;<sub>3</sub>, kecepatan sudut koin pada arah x<sub>3</sub>. Nyatakan dalam &Omega; dan &theta; . (arah x<sub>2</sub> dan x<sub>3</sub> bergerak bersama dengan koin)</p><p>c) Tentukan I<sub>2</sub> dan I<sub>3</sub>, momen inersia koin pada sumbu x<sub>2</sub> dan x<sub>3</sub>!</p><p>d) Momentum sudut terhadap pusat koin dapat dituliskan sebagai <img alt=\"4a\" src=\"https://i.ibb.co/5kwkbCX/4a.jpg\" />. Tentukan besar momentum sudut koin!</p><p>e) Terdapat dua komponen momentum sudut, komponen yang konstan terhadap waktu dan komponen yang berubah terhadap waktu L<sub>berubah</sub>. Tentukan torsi yang bekerja pada koin! (Petunjuk : <a href=\"https://imgbb.com/\"><img alt=\"4b\" src=\"https://i.ibb.co/1235yHW/4b.jpg\" /></a>)</p><p>d) Buktikan bahwa, agar terdapat solusi untuk &Omega; maka, R &gt; &alpha;r sin &theta; Tentukan nilai &alpha;!</p>','','','','','',0,''),(5,'<p>Dua Balok A dan B bermassa sama berada pada bidang miring yang diam dengan Sudut kemiringan 30&deg; terhadap horizontal. Saat t=0, balok A ada diatas B dengan jarak l=5 cm sepanjang lintasan miringnya. (Beda ketinggian A dan B h<sub>AB</sub>&ne;l) dan kedua balok ada dalam keadaan diam. Asumsikan gaya gesek static dan kinetic dari balok pada bidang miring adalah <a href=\"https://imgbb.com/\"><img alt=\"5\" src=\"https://i.ibb.co/yW85g7S/5.jpg\" /></a></p><p>dan kedua balok betumbukan secara elastis. Jika vA (t) dan vB(t) adalah kecepatan dari masing-masing balok saat menuruni bidang miring. Asumsikan g=10ms2 , dimensi balok dapat diabaikan dan balok tidak pernah lepas dari bidang miring.</p><p>a. Kapan dan dimana tumbukan pertama terjadi?</p><p>b. Gambarkan grafik v<sub>A</sub>(t) dan v<sub>B</sub>(t) dari t=0 sampai t=1 s !</p><p>C. Setelah tumbukan ke-n, berapa jarak total yang ditembuh oleh balok A? Tentukan dalam l dan n</p><p>Untuk kasus berikutnya anggap koefisien gesek B adalah B= &radic;3/2, sementara koefisien gesek A tetap.</p><p>c. Gambarkan grafik secara kualitatif untuk v<sub>A</sub>(t) dan v<sub>B</sub>(t) dari t=0 sampai t=1.</p><p>d. Saat t=1, seberapa jauh balok A telah bergerak dari posisi awal!</p>','','','','','',0,''),(6,'<p>Masalah ini dirancang untuk mengilustrasikan keuntungan yang dapat diperoleh dengan penggunaan roket bertingkat banyak daripada roket satu tingkat sebagai kendaraan peluncuran. Misalkan muatan (misalnya, kapsul ruang angkasa) memiliki massa m dan dipasang pada roket dua tingkat (lihat gambar). Massa total (kedua roket terisi penuh, ditambah muatan) adalah Nm.</p><p><a href=\"https://imgbb.com/\"><img alt=\"6\" src=\"https://i.ibb.co/1LkXzjr/6.jpg\" /></a></p><p>Massa roket tahap kedua ditambah muatan, setelah pembakaran dan pemisahan tahap pertama adalah nm. Dalam setiap tahap rasio massa wadah terhadap massa awal (wadah ditambah bahan bakar) adalah r, dan kecepatan buang adalah V, relatif konstan terhadap mesin. Perhatikan bahwa pada akhir setiap keadaan ketika bahan bakar benar-benar habis, wadah langsung turun tanpa mempengaruhi kecepatan roket. Abaikan gravitasi.</p><p>a) Tentukan kecepatan v roket yang diperoleh dari pembakaran tahap pertama, mulai dari keadaan diam! Nyatakan dalam V, N, n, r</p><p>b) Tentukan ekspresi yang sesuai untuk kecepatan tambahan u yang diperoleh dari pembakaran tahap kedua.</p><p>c) Dengan menambahkan v dan u, Anda memiliki kecepatan muatan &omega; dalam hal N, n, dan r. Mengambil N dan r sebagai konstanta, dan nilai n yang w adalah maksimum. Untuk kondisi maksimum ini, dapatkan u/v!</p><p>d) Tentukan formula untuk kecepatan muatan &omega;<sub>s</sub> pada roket satu tingkat dengan nilai N, V, r yang sama!</p><p>e) Misalkan anda akan meluncurkan muatan yang harus mencapai kecepatan akhir 10 km/s menggunakan sebuah roket dengan V=2,5 km/s dan r=0,1 . Gunakan kondisi maksimum yang ditemukan pada bagian (c) , tentukan nilai dari N jika muatan tersebut akan diluncurkan dengan roket dua tingkat!</p>','','','','','',0,''),(7,'<p>Sebuah satelit bertenaga surya dengan kecepatan awal v<sub>0</sub> diluncurkan dari Bumi ke orbit heliosentris elips dengan tujuan mengumpulkan energi matahari sebanyak mungkin. Sudut keberangkatan dapat diubah secara bebas.</p><p>a) Berapa kecepatan peluncuran minimal v<sub>m</sub> yang dibutuhkan satelit untuk mencapai orbit heliosentris?</p><p>b) Berapakah kecepatan satelit sesaat setelah keluar dari medan gravitasi bumi?</p><p>c) Nyatakan rata-rata irradiance/ intensitas radiasi matahari yang mencapai satelit dalam sumbu semi-mayornya a, momentum sudut J, periode orbit T dan massa m!</p><p>Massa Matahari adalah M , jari-jari orbit bumi R, percepatan jatuh bebas di bumi g, jari-jari bumi dan luminositas matahari L.</p>','','','','','',0,'');
/*!40000 ALTER TABLE `fisika` ENABLE KEYS */;
UNLOCK TABLES;

