><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Nelayan di Pantai Selatan Jawa, Bali, dan Nusa Tenggara dapat merasakan dampak positif dari munculnya </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>upwelling </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">dengan meningkatnya jumlah ikan. Kejadian ini terjadi saat munculnya efek Coriolis terhadap angin yang sedang berhembus. Angin yang paling mempengaruhi </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>upwelling </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">di wilayah tersebut adalah:</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Angin muson barat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Angin muson timur</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Angin pasat timur laut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Angin pasat tenggara</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Angin baratan</span></span></span></p>',3,'b'),(9,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Padang lamun </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style