an></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">50 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">5 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">2 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">0,5 hektare</span></span></span></p>',3,'b'),(47,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Perhatikan potongan Peta Rupabumi Indonesia (RBI) berikut ini!</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/h1Q0wVG/Soal-47.png\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Peta tersebut adalah Peta Rupabumi Indonesia, peta topografi terstandar yang mengikuti aturan dan konvensi kartografi dalam penentuan skala dan interval kontur. Jika diperhatikan dari interval garis kontur pada peta tersebut, berapakah skala peta RBI tersebut?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">1:5.000</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">1:10.000</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">1:25.000</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">1:50.000</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">1:250.000</span></span></span></p>',3,'c'),(48,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Seseorang memiliki lahan dengan bentuk segi lima tak beraturan. Lahan tersebut lalu diukur dan didapatkan hasil pengukurannya dalam sistem koordinat lokal dengan satuan meter sebagai berikut:</span></span></span></li></ol><p style=\"margin-left:76px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">A (0, 0) &ndash; titik awal pengukuran</span></span></span></p><p style=\"margin-left:76px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">B (200, 0)</span></span></span></p><p style=\"margin-left:76px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">C (500, 200)</span></span></span></p><p style=\"margin-left:76px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">D (400, 800)</span></span></span></p><p style=\"margin-left:76px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">E (200, 800)</span></span></span></p><p style=\"margin-left:47px\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Luas lahan tersebut adalah:</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">10 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">13 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">26 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">52 hektare</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">65 hektare</span></span></span></p>',3,'c'),(49,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Seorang anggota Pramuka berjalan ke arah timur sepanjang 500 meter, ke arah selatan 100 meter, ke arah timur lagi sejauh 100 meter, dan ke utara sejauh 700 meter. Jika ia membidik dari titik akhir tersebut menuju titik awal ia memulai perjalanan, berapakah nilai azimuth yang ia dapatkan?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">30 derajat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">45 derajat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">135 derajat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">180 derajat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">225 derajat</span></span></span></p>',3,'e'),(50,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jumlah penduduk Indonesia menurut Sensus Penduduk 2020 yang dilakukan BPS adalah 270 juta jiwa, dengan pertumbuhan penduduk sebesar 1,25% per tahun. Jika dihitung dengan rumus pertumbuhan penduduk standar BPS, yaitu rumus geometrik, berapakah jumlah penduduk Indonesia pada tahun 2030?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">303 juta jiwa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">305 juta jiwa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">724 juta jiwa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">876 juta jiwa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">897 juta jiwa</span></span></span></p>',3,'b'),(51,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Perhatikan peta citra sebagian Ternate, Maluku Utara berikut ini!</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/bLrj5cY/Soal-Esai-1.jpg\" /></span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apakah pola penjalaran kota </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>(urban sprawl) </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">yang dominan terjadi di Ternate? [2]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sebutkan 5 jenis penggunaan lahan yang terlihat pada peta! [5]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Nama dari suatu landasan bandar udara </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>(runway) </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">ditentukan oleh azimuth, misalnya salah satu </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>runway </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">bandara Soekarno Hatta dinamakan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>runway </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">06/24 karena memiliki azimuth 60&deg; dan 240&deg; karena dapat diukur dari dua arah. Berilah nama </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>runway </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Bandara Sultan Baabullah di Ternate sesuai aturan berikut! [3]</span></span></span></li></ol>','','','','','',0,''),(52,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Perhatikan grafik Angka Kelahiran Kasar dan Angka Kematian Kasar Indonesia berikut!</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/txz6Tdq/Soal-Esai-2.png\" /></span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Deskripsikan kondisi kelahiran dan kematian di Indonesia dari tahun 1950 s.d. tahun 2010! [5]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berikan periodisasi transisi demografi di Indonesia berdasarkan grafik tersebut! Pada tahun berapa saja kah Indonesia mengalami tahap transisi demografi ke-1, 2, 3, 4, atau 5? [5]</span></span></span></li></ol>','','','','','',0,''),(53,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Indonesia saat ini mengalami fenomena migrasi internal antarwilayah yang tinggi, baik rural-urban maupun urban-urban. Beberapa kota besar seperti Jakarta dan Surabaya mengalami pertumbuhan penduduk total yang tinggi karena tingginya migrasi masuk. Sementara itu, beberapa kota kecil cenderung mengalami fenomena populasi menua </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>(aging population) </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">karena semakin banyaknya usia muda yang keluar dari kota tersebut.</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sebutkan 3 hal yang menjadi faktor penarik migrasi internal di Indonesia! [3]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sebutkan 3 hal yang menjadi faktor pendorong migrasi internal di Indonesia! [3]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berdasarkan teori migrasi Everett Lee, terdapat </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>intervening obstacle </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">(penghalang antara) yang dapat mempengaruhi seseorang untuk bermigrasi. Sebutkan 2 penghalang antara yang mungkin ditemui migran internal di Indonesia! [4]</span></span></span></li></ol>','','','','','',0,''),(54,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Perhatikan gambar berikut!</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img alt=\"\" src=\"https://i.ibb.co/YTmz6wz/Soal-Esai-4.jpg\" /></span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Gambar di atas menunjukkan bentuk mitigasi dari bencana&hellip; [2]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apa fungsi dari konstruksi yang ada pada gambar? [3]</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Sebutkan 5 kegunaan lain dari upaya mitigasi tersebut! [5]</span></span></span></li></ol>','','','','','',0,''),(55,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Seorang surveyor sedang menjelajah untuk melakukan pengukuran menggunakan klinometer abney level, alat yang digunakan untuk mengukur sudut dari mata pengguna ke titik yang dibidik. Sang surveyor menggunakan alat tersebut untuk mengukur dua objek, tinggi mercusuar dan lebar sungai. Diketahui tinggi surveyor adalah 1,9 meter dan tinggi mata surveyor adalah 1,75 meter. Maka hitunglah:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Tinggi mercusuar, jika sudut bidikan puncak mercusuar dari mata surveyor adalah 60&deg;, jarak surveyor dengan dasar mercusuar adalah 30 meter. (sin60&deg; = 0,87; cos60&deg; = 0,5; tan60&deg; = 1,73) [5]</span></span></span></li></ol><p style=\"text-align:center\"><img alt=\"\" src=\"https://i.ibb.co/hm2Px6D/Soal-Esai-5-a.jpg\" /></p><ol start=\"2\">	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Lebar sungai jika sudut bidikan tepi sungai dari mata surveyor adalah 5&deg;. (sin5&deg; = 0,09; cos5&deg; = 0,99; tan5&deg; = 0,09) [5]</span></span></span></li></ol><p style=\"margin-left:72px\"><img alt=\"\" src=\"https://i.ibb.co/BqwHJgp/Soal-Esai-5-b.png\" /></p>','','','','','',0,'');
