<span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Robot penjelajah beroda enam itu secara resmi memulai fase pekerjaan sainsnya pada 1 Juni 2021. Ia telah cukup jauh meninggalkan lokasi pendaratan &quot;Octavia E. Butler&quot; di mana ia mendarat awal tahun ini di Mars. Sejak saat itu Perseverance telah menempuh perjalanan sekitar 0,57 mil atau nyaris 1 kilometer, menurut data geolokasi yang dipasang di badan robot tersebut. Selama perjalanan itu, robot penjelajah tersebut telah membuat beberapa pemberhentian di sepanjang jalan untuk menjelajahi wilayah sekitarnya. Unit geologi S&eacute;&iacute;tah. yang dalam bahasa Navajo berarti &ldquo;di tengah pasir&rdquo;, berdekatan dengan lantai kawah Jezero yang dijuluki Lantai Kawah yang Terpecah-pecah (Crater Floor Fractured Rough). Daerah S&eacute;&iacute;tah dipenuhi dengan bebatuan berlapis dan bukit pasir.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Upaya penjelajahan ini bisa dilakukan berkat mode &quot;AutoNav&quot; canggih dari Perseverance, yang pada dasarnya dapat mengubah robot penjelah itu menjadi mobil yang dapat mengemudi sendiri. Jadi, robot penjelajah tersebut benar-benar bisa melaju dan berjalan di atas enam rodanya untuk menjelajahi lebih banyak wilayah di Mars.</span></span></span></p><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sumber:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>https://nationalgeographic.grid.id/read/132768478/robot-penjelajah-nasa-mengunjungi-panorama-baru-nan-indah-di-mars?page=2</em></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Time