geologis akibat banyaknya aktivitas astronomis seperti badai matahari</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Planet mars adalah gambaran bumi pada masa depan</span></span></span></span></p>','<p>Semua Jawaban Benar</p>',2,'d'),(2,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika robot penjelajah mars mengambil gambar dari ketinggian 120 km dengan resolusi sudut pisah 0,6&rdquo; , berapakah diameter benda terkecil yang dapat diamati robot tersebut?</span></span></span></p>','<p>0,35 m</p>','<p>72 m</p>','<p>35 m</p>','<p>0,072 m</p>','<p>0,57 m</p>',2,'a'),(3,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sebuah batu dilempar lurus dari tebing setinggi 15 m. Berapakah perbandingan kecepatan batu tersebut di dasar planet mars dibandingkan dengan planet berjari-jari 4 kali dan massa jenis sama dengan mars?</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 1:2</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 2:1</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 4:3</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Sekitar 1:4</span></span></