pha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">1,46 kali</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">1,78 kali</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">4,72 kali</span></span></span></p>',2,'c'),(6,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Apabila Mars mengalami oposisi pada tanggal 13 Oktober 2020, kapan oposisi tersebut akan terjadi lagi?</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">5 Desember 2022</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">17 Oktober 2021</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">4 Juni 2022</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">13 Oktober 2022</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">7 Maret 2021</span></span></span></p>',2,'a'),(7,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Planet mars (RA = 01h 22m 59.8s&nbsp; Dec= 5&deg; 28&#39; 17&quot;) pada 13 Oktober 2020 diamati pada kota yogyakarta (Lintang=07&ordm;49&rsquo;26 LS, Bujur=110&ordm;25&rsquo;3 BT) pada jam 20.00 waktu lokal memiliki nilai sudut jam= 20h 28m 56s, berapakah nilai altitude dari mars?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">35,78&ordm;</span></span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">28,5&ordm;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">13,28&ordm;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">7,12&ordm;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">42,2&ordm;</span></span></span></p>',2,'a'),(8,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika diketahui modulus elastisitas dari batuan permukaan mars adalah 3 x 10<sup>8</sup>&nbsp;Pascal, Berapakah ketinggian maksimum dari gunung pada permukaan planet mars?&nbsp;</span></span></span></p>','<p>20,6 Km</p>','<p>10,3 Km</p>','<p>26,8 Km</p>','<p>13,8 Km</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Data yang diberikan tidak cukup</span></span></span></p>',2,'a'),(10,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Planet mars berdekatan dengan sabuk asteroid. Salah satu jenis asteroid yang memiliki kandungan bahan organik yang melimpah adalah&hellip;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">A-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">C-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">S-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">M-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">O-type asteroid</span></span></span></p>',2,'b'),(12,'<p>Berikut deskripsi untuk soal nomor 12 - 18</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Megathrust, Apa Itu?</strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pulau Jawa dikabarkan memiliki potensi terkena tsunami setinggi 20 meter di Selatan Pulau Jawa. Bahkan, gelombang lautan raksasa tersebut diperkirakan hanya butuh waktu selama 20 menit untuk sampai pinggir pantai. Sebenarnya, apa yang disebut sebagai zona Megathrust? Dan bagaimana dampaknya terhadap kehidupan manusia?</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Zona Megathrust sendiri didefinisikan sebagai pusat gempa yang terletak pada bidang kontak antarlempeng dengan kedalaman kurang dari 45-50 km, dimana subduksi masih berlangsung dengan sudut yang landai dan belum menukik. Gempa ini mengakibatkan gempa-gempa bumi terbesar di dunia, seperti gempa bumi di Chile pada tahun 1960 dengan magnitude 9,5, gempa di Alaska pada tahun 1964 dengan magnitude 9,2 dan gempa Aceh pada tahun 2004 dengan magnitude sebesar 9,0.&nbsp; Untuk dapat menimbulkan tsunami, sebuah gempa harus memiliki beberapa syarat yaitu kekuatan yang besar, hiposentrum yang dangkal dan pergerakan berupa sesar naik.</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Skenario yang banyak dikhawatirkan masyarakat saat ini adalah apabila lempeng segmen selatan Jawa Barat dan Banten pecah maka diprediksikan akan mengalami gempa sebesar &hellip; SR. Sedangkan apabila lempeng segmen selatan Jawa Tengah dan Timur pecah, maka diprediksikan akan mengalami gempa sebesar &hellip; SR. Dan apabila kedua segmen lempeng pecah, maka diprediksikan akan terjadi gempa sebesar &hellip; SR. Secara historis, gempa besar dengan magnitudo antara 7,0 dan 7,9 yang bersumber di zona megathrust selatan Jawa sudah terjadi sebanyak 8 kali, yaitu: tahun 1903 (M7,9), 1921 (M7,5), 1937 (M7,2), 1981 (M7,0), 1994 (M7,6), 2006 (M7,8) dan 2009 (M7,3).</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sebenarnya, terdapat 13 zona Megathrust di Republik Indonesia. Rinciannya adalah megathrust Aceh-Andaman, Nias-Simelue, Batu, Mentawai Siberut dan Mentawai-Pagai. megathrust Enggano, Selat Sunda, Jawa Barat-Jawa Tengah, Jawa Timur, dan Sumba. Berikutnya megathrust Sulawesi Utara, Filipina, dan Papua. Intinya terdapat pada tepi benua aktif dengan aktivitas subduksi.</span></span></span></p><p><br /><img alt=\"\" src=\"https://i.ibb.co/hCbbp4Y/geo12.jpg\" style=\"height:348px; width:300px\" /></p><p><img alt=\"\" src=\"https://i.ibb.co/4Vy5v6F/geo122.jpg\" style=\"height:273px; width:400px\" /></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berdasarkan bacaan di atas, pilihlah pernyataan yang </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>tidak benar </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">mengenai gempa yang terjadi pada Megathrust!</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa yang disebabkan oleh Megathrust disebut pula sebagai gempa </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>swarm</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa yang disebabkan oleh Megathrust berpotensi memiliki magnitudo di atas 8,0 hingga di atas 9,0 skala Richter.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat 13 segmen zona gempa megathrust yang letaknya bertampalan dengan batas subduksi lempeng di Indonesia.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa Megathrust adalah gempa dangkal dengan kedalaman kurang dari 40-60 km.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tsunami pada Gempa Megathrust dapat terjadi dikarenakan adanya pergerakan yang menghasilkan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>reverse fault </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">maupun </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>thrust fault</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">.</span></span></span></p>',2,'a');
/*!40000 ALTER TABLE `kebumian` ENABLE KEYS */;
UNLOCK TABLES;

