INSERT INTO `kimia` VALUES (1,'<p>Sebanyak 2,7 g logam magnesium dilarutkan ke dalam 100 mL larutan HCl 0,1 M. Diketahui bahwa persen hasil reaksi ini adalah 85%. Maka massa endapan yang akan didapatkan adalah sebanyak &hellip;</p>','<p>18,10 g</p>','<p>25,05 g</p>','<p>3,195 g</p>','<p>2,715 g</p>','<p>Tidak ada jawaban yang tepat</p>',1,'e'),(2,'<p>Berikut adalah persamaan reaksi kesetimbangan ion dikromat dan kromat dalam air (mungkin belum setara):</p><p>Cr<sup>2</sup>O<sub>7</sub><sup>2-</sup><sub>(aq)</sub>â‡ŒCrO<sub>4</sub><sup>2-</sup><sub>(aq)</sub></p><p>dengan seluruh konsentrasi reaktan dan produk sama yakni 1,00 M. Kemudian suatu peristiwa terjadi dan apabila di plot perubahan konsentrasi H<sup>+</sup> terhadap koordinat reaksi&nbsp;akan&nbsp;menjadi&nbsp;:</p><p><a href=\"https://imgbb.com/\"><img alt=\"2\" src=\"https://i.ibb.co/bNLmBS4/2.jpg\" /></a></p><p>Maka&nbsp;tentukan&nbsp;proses&nbsp;yang&nbsp;harus&nbsp;dilakukan&nbsp;untuk&nbsp;menghasilkan&nbsp;kurva&nbsp;tersebut&nbsp;dan&nbsp;yang&nbsp;akan&nbsp;terjadi&nbsp;(berurutan)&nbsp;berdasarkan&nbsp;perubahan&nbsp;konsentrasi&nbsp;asam&nbsp;di&nbsp;atas...</p>','<p>Menambahkan&nbsp;sejumlah&nbsp;ion&nbsp;dikromat&nbsp;ke&nbsp;dalam&nbsp;wadah&nbsp;reaksi&nbsp;;&nbsp;Konsentrasi&nbsp;ion&nbsp;kromat&nbsp;akan&nbsp;naik</p>','<p>Menambahkan&nbsp;sejumlah&nbsp;basa&nbsp;ke&nbsp;dalam&nbsp;wadah&nbsp;reaksi&nbsp;;&nbsp;Konsentrasi&nbsp;ion&nbsp;kromat&nbsp;akan&nbsp;turun</p>','<p>Menambahkan&nbsp;sejumlah&nbsp;ion&nbsp;kromat&nbsp;ke&nbsp;dalam&nbsp;wadah&nbsp;reaksi&nbsp;;&nbsp;Konsentrasi&nbsp;ion&nbsp;dikromat&nbsp;akan&nbsp;naik</p>','<p>Menambahkan&nbsp;sejumlah&nbsp;asam&nbsp;ke&nbsp;dalam&nbsp;wadah&nbsp;reaksi&nbsp;;&nbsp;Konsentrasi&nbsp;ion&nbsp;kromat&nbsp;tetap</p>','<p>Menambahkan&nbsp;sejumlah&nbsp;air&nbsp;ke&nbsp;dalam&nbsp;;&nbsp;Konsentrasi&nbsp;ion&nbsp;kromat&nbsp;akan&nbsp;turun</p>',1,'a'),(3,'<p>Tentukan perbandingan volume asam terhadap basa yang digunakan untuk membuat larutan pH=pK<sub>a2</sub> dengan mencampurkan 1,0 M H<sub>3</sub>PO<sub>4</sub> dengan 1,0 M KOH, apabila diketahui pK<sub>a1</sub>=2,16; pK<sub>a2</sub>=7,21; pK<sub>a3</sub>=12,32!</p>','<p>3:2</p>','<p>1:2</p>','<p>2:1</p>','<p>2:3</p>','<p>1:1</p>',1,'d'),(4,'<p>Diketahui garam Cr(NO<sub>3</sub>)<sub>3</sub> dan Zn(NO<sub>3</sub>)<sub>2</sub> mudah larut dalam air, pada keadaan standard (25<sup>o</sup> C, 1atm, 1M), potensial reduksi adalah :</p><p>Cr<sup>3+</sup><sub>(aq)</sub> + 3e &rarr;Cr <sub>(s)</sub> E<sup>o</sup><sub>red</sub>= -0,740 V</p><p>Zn<sup>2+</sup><sub>(aq)</sub> + 2e &rarr;Zn <sub>(s)</sub> E<sup>o</sup><sub>red</sub>= -0,763 V</p><p>Perhatikan diagram sel berikut :</p><p><a href=\"https://imgbb.com/\"><img alt=\"4\" src=\"https://i.ibb.co/kDHp7Fv/4.jpg\" /></a></p><p>Maka tentukan nilai potensial sel pada reaksi spontan tersebut pada suhu 37<sup>0</sup>C...</p>','<p>0,034 V</p>','<p>0,053 V</p>','<p>0,006 V</p>','<p>0,012 V</p>','<p>0,044 V</p>',1,'b'),(5,'<p>Reaksi penguraian dimetil eter mengikuti persamaan berikut :</p><p>(CH3)2O(g) CH4(g) + H2(g) + CO(g)</p><p>Pada temp. 450 oC nilai tetapan laju reaksi (k) orde pertama sebesar 3,2&times;10&minus;4 s&minus;1. Reaksi ini dilakukan dalam wadah tertutup dengan volume tetap. Asumsikan semua gas yang terlibat adalah gas ideal. Pada saat awal reaksi hanya terdapat dimetil eter yang tekanannya 0,35 atm. Setelah reaksi berlangsung selama 8 menit,maka tekanan total sistem adalah ...</p>','<p>0,45 atm</p>','<p>0,05 atm</p>','<p>0,30 atm</p>','<p>0,35 atm</p>','<p>0,15 atm</p>',1,'a'),(6,'<p>Berikut larutan 0,1 M yang akan mengendap dengan penambahan sedikit NaCl 0,1 M namun akan larut kembali apabila dipanaskan...</p>','<p>Cu(NO<sub>3</sub>)<sub>2</sub></p>','<p>Pb(NO<sub>3</sub>)<sub>2</sub></p>','<p>AgNO<sub>3</sub></p>','<p>Fe(NO<sub>3</sub>)<sub>3</sub></p>','<p>Al(NO<sub>3</sub>)<sub>3</sub></p>',1,'b'),(7,'<p>Senyawa&nbsp;kompleks&nbsp;kobalt&nbsp;dengan&nbsp;rumus&nbsp;molekul&nbsp;CoCl<sub>3</sub>.6H<sub>2</sub>O&nbsp;dapat&nbsp;larut&nbsp;dalam&nbsp;air&nbsp;membentuk&nbsp;ion&nbsp;kompleks.&nbsp;Apabila&nbsp;sejumlah&nbsp;2,734&nbsp;g&nbsp;senyawa&nbsp;ini&nbsp;dilarutkan&nbsp;ke&nbsp;dalam&nbsp;100&nbsp;mL&nbsp;air,&nbsp;dan&nbsp;memerlukan&nbsp;16,80&nbsp;mL&nbsp;perak&nbsp;(I)&nbsp;nitrat&nbsp;1,190&nbsp;M&nbsp;untuk&nbsp;mengendapkan&nbsp;ion&nbsp;klorida&nbsp;bebas&nbsp;terlarut,&nbsp;maka&nbsp;tentukan&nbsp;rumus&nbsp;kompleks&nbsp;kobalt&nbsp;ini!</p>','<p>[CoCl<sub>3</sub>(H<sub>2</sub>O)<sub>3</sub>].3H<sub>2</sub>O</p>','<p>[CoCl<sub>2</sub>(H<sub>2</sub>O)<sub>4</sub>]Cl.2H<sub>2</sub>O</p>','<p>[CoCl(H<sub>2</sub>O)<sub>5</sub>]Cl<sub>2</sub>.H<sub>2</sub>O</p>','<p>[Co(H<sub>2</sub>O)<sub>6</sub>]Cl<sub>3</sub></p>','<p>CoCl<sub>3</sub>.6H<sub>2</sub>O</p>',1,'c'),(8,'<p>Perhatikan skema sintesis untuk membentuk produk Z berikut : <a href=\"https://imgbb.com/\"><img alt=\"8\" src=\"https://i.ibb.co/z8vX8nM/8.jpg\" /></a> Manakah diantara pernyataan berikut yang benar?</p>','<p>Produk&nbsp;Z&nbsp;adalah&nbsp;suatu&nbsp;alkohol</p><p>&nbsp;</p>','<p>Fungsi&nbsp;LiAlH(O-t-Bu)3&nbsp;adalah&nbsp;untuk&nbsp;mengoksidasi&nbsp;menghasilkan&nbsp;gugus&nbsp;aldehida&nbsp;pada&nbsp;produk&nbsp;Z</p>','<p>Produk&nbsp;Z&nbsp;dapat&nbsp;bereaksi&nbsp;dengan&nbsp;metilamina&nbsp;membentuk&nbsp;suatu&nbsp;imina</p>','<p>Fungsi&nbsp;KMnO4/OH-&nbsp;panas&nbsp;adalah&nbsp;untuk&nbsp;mengoksidasi&nbsp;gugus&nbsp;benzena&nbsp;menjadi&nbsp;kuinon</p>','<p>SOCl2&nbsp;adalah&nbsp;agen&nbsp;klorinasi&nbsp;pada&nbsp;gugus&nbsp;fenil.</p>',1,'c'),(9,'<p>Tentukan hubungan yang tepat antara ketiga senyawa berikut : <img alt=\"9\" src=\"https://i.ibb.co/1qMV6SD/9.jpg\" /></p>','<p>Senyawa&nbsp;I&nbsp;dan&nbsp;II&nbsp;adalah&nbsp;pasangan&nbsp;enantiomer</p>','<p>Senyawa&nbsp;I&nbsp;dan&nbsp;III&nbsp;adalah&nbsp;senyawa&nbsp;meso</p>','<p>Senyawa&nbsp;II&nbsp;dan&nbsp;III&nbsp;adalah&nbsp;bukan&nbsp;pasangan&nbsp;diastereoisomer</p>','<p>Senyawa&nbsp;II&nbsp;adalah&nbsp