INSERT INTO `komputer` VALUES (1,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><u>Jumlah</u></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> dari semua</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong> </strong></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">bilangan bulat positif kurang dari 10000 yang habis dibagi 3 tetapi tidak habis dibagi 7 adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'14284287'),(2,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berapa banyak bilangan bulat positif kurang dari 2021 yang faktor prima terbesarnya bernilai kurang dari 5? Contoh bilangan yang memenuhi syarat adalah 6 (6 = 2x3, 3 &lt; 5), 9 (9 = 3x3, 3 &lt; 5), dan 1 (pengecualian). </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'47'),(3,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Nilai x maksimum yang mungkin sehingga 2021! habis dibagi 10^x adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'503'),(4,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Diketahui suatu restoran menjual dua jenis makanan, yaitu soto dan sate, masing-masing bisa memiliki rasa pedas atau tidak. Diketahui informasi berikut:</span></span></span>	<ol>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Terdapat 70 orang yang masing-masing memesan tepat 1 jenis makanan.</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Banyak orang yang memesan makanan tidak pedas dua kali banyak orang yang memesan soto.</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Banyak orang yang memesan soto pedas dan sate pedas berjumlah sama.</span></span></span></li>	</ol>	</li></ol><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Banyak orang yang memesan soto atau makanan pedas adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'35'),(5,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila Pak Dengklek memiliki himpunan {1, 2, 3, 4, 5}, maka banyak kelompok minimum yang dibutuhkan adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'3'),(6,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila Pak Dengklek memiliki himpunan berisi bilangan bulat dari 1 sampai 2021, maka banyak kelompok minimum yang dibutuhkan adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'810'),(7,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Suatu bilangan dikatakan indah jika dalam representasi desimalnya setiap dua digit yang bersebelahan nilainya berbeda. Contoh bilangan indah adalah 0, 5, 45, 101, dan 5861, sedangkan contoh bilangan tidak indah adalah 11, 300, 5002, dan 91227. Berapa bilangan bulat positif indah yang bernilai kurang dari 1000? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> </span></span></span></p>','','','','','',1,'819'),(8,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berapa banyak bilangan bulat positif yang habis membagi 1540, 1764, dan 2800? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'6'),(9,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek ingin memiliki tepat 2021 lembar kertas (tidak peduli ukurannya). Awalnya ia memiliki 0 lembar. Ia dapat melakukan dua operasi berikut:</span></span></span>	<ol>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Membeli selembar kertas baru</span></span></span></li>		<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Memotong semua kertas yang dimilikinya masing-masing menjadi dua lembar kertas. Dengan kata lain, Pak Dengklek memiliki 2 kali lembar kertas dari sebelumnya.</span></span></span></li>	</ol>	</li></ol><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berapa banyak operasi minimum yang diperlukan?</span></span></span></p><p>&nbsp;</p>','','','','','',1,'18'),(10,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em><u>Berikut merupakan deskripsi untuk soal nomor 10 dan 11.</u></em></strong></span></span></span></p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Kwak, Kwek, Kwik, Kwok, dan Kwuk sedang berkumpul bersama. Mereka sedang membandingkan ketinggian mereka. Diketahui bahwa Kwak lebih pendek daripada Kwuk; Kwek lebih pendek daripada Kwik, tetapi lebih tinggi daripada Kwak; dan Kwik lebih tinggi daripada Kwok.</span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Siapa sajakah kemungkinan bebek yang paling pendek diantara mereka? Tulis nama-nama bebek yang mungkin menjadi bebek paling pendek dipisahkan oleh spasi dan dengan urutan Kwak, Kwek, Kwik, Kwok, lalu Kwuk. Misal kemungkinan bebek paling pendek adalah Kwuk dan Kwek, maka tulis &ldquo;Kwek Kwuk&rdquo; tanpa tanda petik.</span></span></span></p>','','','','','',1,'kwak kwok'),(11,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Apabila diketahui Kwok lebih tinggi daripada Kwak dan tidak ada bebek yang memiliki ketinggian yang sama, maka berapa banyak urutan ketinggian bebek yang mungkin? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'8'),(12,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek ingin menghias rumahnya menggunakan lampu warna warni yang disusun berderet. Ia mempunyai 8 lampu warna merah dan 4 lampu warna biru. Supaya terlihat indah, Pak Dengklek tidak ingin ada dua lampu warna biru yang bersebelahan. Berapa banyak susunan berbeda yang mungkin? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'126'),(13,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Ganesh tidak mau kalah dengan Pak Dengklek. Ia juga akan menghias rumahnya dengan lampu warna warni. Pak Ganesh memiliki 8 lampu merah, 4 lampu biru, dan 3 lampu hijau. Supaya terlihat lebih indah, Pak Ganesh tidak ingin ada dua lampu dengan warna yang sama bersebelahan. Berapa banyak susunan berbeda yang mungkin?</span></span></span></p>','','','','','',1,'35'),(14,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek membuat permainan baru. Ia memiliki 15 petak yang masing-masing bertulis angka 1, 2, 3, 1, 1, 1, 2, 2, 1, 3, 2, 2, 1, 2, dan 1 (berturut-turut dari petak ke-1 sampai petak ke-15). Pak Dengklek sedang berada di petak ke-1 (petak paling kiri) dan ingin pergi ke petak ke-15 (petak paling kanan). Apabila Pak Dengklek berada pada petak yang bertulis angka X, maka ia hanya dapat melompat ke petak lain dengan jarak paling banyak X. Misalnya, apabila Pak Dengklek berada pada petak ke-7 yang tertulis angka 2, maka ia hanya dapat pergi ke petak 5, 6, 7, 8, atau 9. Berapa banyak lompatan minimum yang dibutuhkan Pak Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'9'),(15,'<p style=\"margin-left:24px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em><u>Berikut merupakan deskripsi untuk soal nomor 15 dan 16.</u></em></strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek ingin masuk ke akun media sosial Bu Dengklek. Tetapi ia tidak tahu </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>password</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">-nya. Untungnya, selama 20 tahun hidup bersama, Pak Dengklek mempunyai beberapa petunjuk mengenai </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>password</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">-nya:</span></span></span></p><ol>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>Password</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> terdiri dari 8 huruf kapital, di mana terdapat 3 huruf vokal (&#39;A&#39;, &#39;E&#39;, &#39;I&#39;, &#39;O&#39;, atau &#39;U&#39;) dan 5 huruf konsonan.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Huruf &#39;D&#39;, &#39;E&#39;, &#39;N&#39;, &#39;G&#39;, &#39;K&#39;, dan &#39;L&#39; pasti ada di dalam </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>password</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> tersebut.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Setiap huruf vokal berada pada posisi dengan nilai prima (posisi ke-1 adalah huruf paling kiri dan posisi ke-i berada tepat di sebelah kanan posisi ke-(i-1)).</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">&lsquo;L&rsquo; berada di antara &lsquo;D&rsquo; dan &lsquo;K&rsquo;.</span></span></span></li>	<li style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">&lsquo;L&rsquo; dan &lsquo;G&rsquo; dipisahkan oleh tepat 1 huruf vokal.</span></span></span></li></ol><p style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Berapa banyak percobaan minimum yang diperlukan Pak Dengklek dalam kasus terburuk supaya dapat masuk ke akun Bu Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'1952'),(16,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek tiba-tiba mengingat dua huruf terakhir </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><em>password</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">-nya adalah &lsquo;K&rsquo; dan &lsquo;N&rsquo; berturut-turut serta semua huruf vokalnya adalah huruf &lsquo;E&rsquo;. Dengan tambahan informasi tersebut, maka banyak percobaan minimum yang diperlukan Pak Dengklek dalam kasus terburuk adalah &hellip;. </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'2'),(17,'<p style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek akan mengirimkan suatu kode kepada temannya. Pak Dengklek mempunyai fungsi F yang akan mengubah suatu kode menjadi kode lain menggunakan tabel berikut.&nbsp;</span></span></span></p><div style=\"margin-left:41px\"><table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; width:426px\">	<tbody>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:46px\">			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Awal</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertica