INSERT INTO `matematika` VALUES (1,'<p>Diberikan ABCD segiempat konveks dengan AB = BC dan &ang;ADC = &ang;BAD + &ang;BCD. Nilai dari <sup>BD</sup>/<sub>DC</sub> adalah...</p>','','','','','',1,''),(2,'<p>Lingkaran&nbsp;dalam&nbsp;segitiga&nbsp;ABC&nbsp;dengan&nbsp;pusat&nbsp;I&nbsp;menyinggung&nbsp;sisi&nbsp;AB&nbsp;di&nbsp;C&lt;sub&gt;1&lt;/sub&gt;&nbsp;dan&nbsp;menyinggung sisi&nbsp;BC&nbsp;di&nbsp;A&lt;sub&gt;1&lt;/sub&gt;.&nbsp;Garis&nbsp;AI&nbsp;dan&nbsp;C&lt;sub&gt;1&lt;/sub&gt; A&lt;sub&gt;1&lt;/sub&gt;&nbsp;berpotongan&nbsp;di&nbsp;titik&nbsp;M.&nbsp;Jika diketahui&nbsp;bahwa&nbsp;AC&nbsp;=&nbsp;68,&nbsp;&ang;A&nbsp;=&nbsp;30&deg;,&nbsp;maka&nbsp;luas&nbsp;segitiga&nbsp;AMC adalah...</p>','','','','','',1,''),(3,'<p>Jika&nbsp;untuk&nbsp;bilangan&nbsp;real&nbsp;x {x}&nbsp;menyatakan&nbsp;bagian&nbsp;pecahan&nbsp;dari&nbsp;x,&nbsp;maka&nbsp;jumlahan&nbsp;semua solusi&nbsp;dari&nbsp;persamaan</p><p>{2{3{4x}}}&nbsp;=&nbsp;x</p><p>adalah...</p>','','','','','',1,''),(4,'<p>Banyaknya solusi bulat dari persamaan</p><p>x<sup>3</sup> (y &minus; z)<sup>3</sup> + y<sup>3</sup>(z &minus; x)<sup>3</sup> + z<sup>3</sup>(x &minus; y)<sup>3</sup> = 36</p><p>adalah...</p>','','','','','',1,''),(5,'<p>Diketahui bilangan-bilangan real x, y, z memenuhi</p><p>x<sup>3</sup> + x(y<sup>2</sup> + yz + z<sup>2</sup>) = 76</p><p>y<sup>3</sup> + y(z<sup>2</sup> + zx + x<sup>2</sup>) = 34</p><p>z<sup>3</sup> + z(x<sup>2</sup> + xy + y<sup>2</sup>) = &minus;29</p><p>Nilai dari&nbsp;<sup>30y</sup> / <sub>(3x + y + 2z)&nbsp;</sub>adalah...</p>','','','','','',1,''),(6,'<p>Diketahui P(x) suku banyak berderajat-n dengan koefisien bilangan-bilangan bulat yang memenuhi</p><p>P(1 + &radic;2) = 54 + 29&radic;2</p><p>P(1 + &radic;3) = 89 + 44&radic;3</p><p>P(1 + &radic;5) = 189 + 80&radic;5</p><p>Nilai terkecil untuk derajat n yang mungkin adalah...</p>','','','','','',1,''),(7,'<p>Banyak faktor positif dari 2015<sup>8</sup> yang bukan merupakan bilangan kuadrat adalah...</p>','','','','','',1,''),(8,'<p>Seekor katak berada pada titik O(0,0). Dari titik (x, y) katak tersebut dapat bergerak ke titik (x + 1, y), (x + 2, y), (x, y + 1) atau (x, y + 2). Banyak langkah berbeda yang dapat diambil katak tersebut untuk bergerak dari titik O(0,0) ke (4,4) adalah...</p>','','','','','',1,''),(9,'<p>Diketahui p, q adalah bilangan-bilangan real sehingga untuk setiap bilangan real 1 &le; x &le; 4 berlaku</p><p>|x<sup>3</sup> &minus; 3x<sup>2</sup> &minus; pz &minus; q| &le; <sup>(3&radic;3 &minus; 1)</sup> / <sub>2</sub></p><p>Nilai dari p<sup>2</sup> + (2q + 17)<sup>2</sup> adalah...</p>','','','','','',1,''),(10,'<p>Diketahui bahwa 0 &lt; u &lt; &radic;2, v &gt; 0. Nilai terkecil yang mungkin dari</p><p>(u &minus; v)<sup>2</sup> + ( &radic;(2 - u<sup>2</sup>) &minus; u<sup>2</sup> &minus; (<sup>9</sup> / <sub>v</sub>) )<sup>2</sup></p><p>adalah...</p>','','','','','',1,''),(11,'<p>Diberikan segienam beraturan ABCDEF dengan panjang sisi 2. Lingkaran dengan panjang jari-jari 3 dan pusat A digambar. Tentukan luas area di dalam segiempat BCDE yang terletak diluar lingkaran tersebut.</p>','','','','','',1,''),(12,'<p>Diketahui S adalah suatu himpunan beranggotakan suku banyak dengan koefisien bilangan bulat yang memenuhi P(&minus;10) = 145, P(9) = 164. Nilai terkecil yang mungkin untuk P(0) pada S adalah...</p>','','','','','',1,''),(13,'<p>Diketahui P suku banyak dengan koefisien bulat berderajat 2019 sehingga</p><p>i.) Untuk setiap bilangan bulat n, P(n) + P(&minus;n) = 2</p><p>ii.) 101<sup>2&nbsp;</sup>| P(1) + P(2) + â‹¯ + P(100)</p><p>Sisa pembagian P(101) oleh 101<sup>2</sup> adalah...</p>','','','','','',1,''),(14,'<p>Terdapat 10 kuda dan n benteng pada papan catur sehingga tidak ada dua buah catur yang saling serang. Nilai terbesar n yang mungkin adalah...</p>','','','','','',1,''),(15,'<p>Penyelesaian sistem persamaan</p><p>&radic;(1 + x<sub>1</sub>) + &radic;(1 + x<sub>2</sub>) + â‹¯ + &radic;(1 + x<sub>100</sub>) = 100 &radic;(1 + <sup>1</sup> / <sub>100</sub>)</p><p>&radic;(1 &minus; x<sub>1</sub>) + &radic;(1 &minus; x<sub>2</sub>) + â‹¯ + &radic;(1 &minus; x<sub>100</sub>) = 100 &radic;(1 &minus; <sup>1</sup> / <sub>100</sub>)</p><p>adalah...</p>','','','','','',1,''),(16,'<p>Diberikan bilangan real positif x. Tunjukkan bahwa</p><p>&radic;(6x + 9) + &radic;(16x + 64) &le; ( &radic;x + <sup>3</sup> / <sub>&radic;x</sub>&nbsp;) ( &radic;x +&nbsp;<sup>8</sup> / <sub>&radic;x</sub>&nbsp;)</p>','','','','','',0,''),(17,'<p>Diberikan P(x) suku banyak monik berderajat 10 dengan akar-akar r<sub>1</sub>, r<sub>2</sub>, ... , r<sub>10</sub> &ne; 0. Dibentuk Q(x) suku banyak monik berderajat 45 dengan akar-akar</p><p><sup>1</sup> / <sub>r<sub>i</sub></sub> + <sup>1</sup> / <sub>r<sub>j</sub></sub> &minus; <sup>1</sup> / <sub>r<sub>i</sub></sub><sub>r<sub>j</sub></sub>, i &lt; j.</p><p>Jika diketahui P(0) = Q(1) = 2, tentukan nilai dari |P(1)|</p>','','','','','',0,''),(18,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pak Dengklek mempunyai himpunan bilangan {1, 4, 10}. Ia ingin membuat semua bilangan di dalam himpunan tersebut bernilai sama. Dalam satu langkah, Pak Dengklek dapat menambahkan 1 kepada tepat 2 bilangan dalam himpunan tersebut. Contohnya, Pak Dengklek dapat menambahkan 1 kepada bilangan pertama dan ketiga, sehingga himpunan menjadi {2, 4, 11}. Berapa banyak langkah minimum yang dibutuhkan Pak Dengklek? </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong><em>{tulis jawaban dalam bentuk angka}</em></strong></span></span></span></p>','','','','','',1,'13'),(19,'<p>Tentukan semua bilangan prima p, sehingga p<sup>2</sup> &minus; 2,2p<sup>2</sup> &minus; 1, dan 3p<sup>2</sup> + 4 juga merupakan bilangan prima.</p>','','','','','',0,''),(20,'<p>Berapa banyak bilangan maksimal yang dapat dipilih dari himpunan</p><p>{1,2, ... ,2005}</p><p>sehingga setiap dua bilangan yang terpilih selisihnya tidak sama dengan 5?</p>','','','','','',0,'');
